import classes from '*.module.css';
import React from 'react';
import './Node.css'

const Node = ({ isStart, isEnd, row, col }) => {
    // const classes = isStart ? "node_start" : isEnd ? "node_end" : "";
    const classes = "";
    if (isStart) {
        classes = "node_start";
    };
    if (isEnd) {
        classes = "end_node";
    };


    return (
        <div className={`node ${classes}`} id={`node-${row}-${col}`}>

        </div>
    )
}

export default Node;
